import React from "react";

export default function FreelancerDetail() {
  return (
    <div
      style={{ backgroundColor: "#171717", width: "100vw", height: "100vh" }}
    >
      <div
        className="details-top"
        style={{
          display: "flex",
          justifyContent: "space-around",
        }}
      >
        <div className="freelancer-name" style={{ margin: "70px 0 0 0" }}>
          <h4 style={{ color: "#fff", fontSize: "45px", fontWeight: "700" }}>
            Hi , I am
          </h4>
          <h4 style={{ color: "#fff", fontSize: "45px", fontWeight: "700" }}>
            Freelancer Name
          </h4>
        </div>
        <div className="freelancer-photo">
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTk_YVFhrmGIHOl5zbB0w7rbxR5WypU98C6FA&usqp=CAU"
            alt="#"
            width={"350px"}
            height={"350px"}
            style={{ borderRadius: "300px" }}
          />
        </div>
      </div>
    </div>
  );
}
